import React from 'react'
import { View, Text, StyleSheet } from 'react-native';
const Search = () => {
  return (
    <View style={styles.container}>
      <View style={styles.parameter}>
        <Text style={styles.parameterName}>Voltage level:</Text>
        <Text>Input under voltage - 175V and below.</Text>
        <Text>Input over voltage - 270V and above.</Text>
      </View>
      <View style={styles.parameter}>
        <Text style={styles.parameterName}>Current:</Text>
        <Text>Over Current - 33A.</Text>
      </View>
      <View style={styles.parameter}>
        <Text style={styles.parameterName}>Frequency:</Text>
        <Text>Under frequency - 47HZ.</Text>
        <Text>Over frequency - 53HZ.</Text>
      </View>
      <View style={styles.parameter}>
        <Text style={styles.parameterName}>Temperature:</Text>
        <Text>Low Temperature - 0°C.</Text>
        <Text>High Temperature - 58°C.</Text>
      </View>
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    backgroundColor: '#ffffff',
  },
  parameter: {
    marginBottom: 15,
  },
  parameterName: {
    fontWeight: 'bold',
    marginBottom: 5,
  },
});

export default Search
